import React, { useState } from 'react';
import { Typography, Button, Modal, Backdrop, Fade, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';
import { Add } from '@mui/icons-material';
import Layout from '../layout/mainpage';
import Sidebar from '../layout/sidebar';
import UsuarioForm from '../common/usuarioForm';
import { makeStyles } from '@mui/styles';

const useStyles = makeStyles((theme) => ({
  paper: {
    marginTop: theme.spacing(2),
    marginBottom: theme.spacing(2),
    padding: theme.spacing(2),
  },
  addButton: {
    marginBottom: theme.spacing(2),
  },
}));

const UsuariosPage = () => {
  const classes = useStyles();
  const [openModal, setOpenModal] = useState(false);

  const handleOpenModal = () => {
    setOpenModal(true);
  };

  const handleCloseModal = () => {
    setOpenModal(false);
  };

  return (
    <Layout>
      <Sidebar />
      <div className={classes.paper}>
        <Typography variant="h4" gutterBottom>
          Usuarios
        </Typography>
        <Button
          variant="contained"
          color="primary"
          startIcon={<Add />}
          onClick={handleOpenModal}
          className={classes.addButton}
        >
          Nuevo Usuario
        </Button>

        {/* Tabla de usuarios */}
        <TableContainer component={Paper}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Nombre</TableCell>
                <TableCell>Apellido</TableCell>
                <TableCell>Usuario</TableCell>
                <TableCell>Rol</TableCell>
                {/* Agrega más encabezados según sea necesario */}
              </TableRow>
            </TableHead>
            <TableBody>
              {/* Renderiza filas de la tabla aquí */}
            </TableBody>
          </Table>
        </TableContainer>

        {/* Modal para agregar/editar usuarios */}
        <UsuarioForm open={openModal} handleClose={handleCloseModal} />
      </div>
    </Layout>
  );
};

export default UsuariosPage;
